def run_async(func):
    @wraps(func)
    def _wrapper(*args, **kwargs):
        call_result = Future()

        def _run():
            loop = asyncio.new_event_loop()
            try:
                result = loop.run_until_complete(func(*args, **kwargs))
            except Exception as error:
                call_result.set_exception(error)
            else:
                call_result.set_result(result)
            finally:
                loop.close()

        loop_executor = ThreadPoolExecutor(max_workers=1)
        if has_request_context():
            _run = copy_current_request_context(_run)
        loop_future = loop_executor.submit(_run)
        loop_future.result()
        return call_result.result()

    return _wrapper

def hant_2_hans(hant_str: str):
    '''
    Function: 将 hant_str 由繁体转化为简体
    '''
    return zhconv.convert(hant_str, 'zh-hans')

class WhisperTranscriber(object):

    def __init__(self, model_name):
        self.model = whisper.load_model(model_name)

    def whisper_transcribe(self, audio_path):
        audio = self.model.transcribe(audio_path, fp16=False, language='Chinese')
        return audio['text']

transcriber = WhisperTranscriber("small")       #如果不支持异步的话，最好提前加载好模型，这样会减少load模型的时间

def asr_process_api(inputjson):
    s_time = time.time()
    #print("trans wav")
    decode_string = base64.b64decode(inputjson['wavBase64'])
    curname = "".join(str(datetime.datetime.now())).replace(' ', '_').replace(':', '_') + '_' + str(
        random.uniform(1.1, 8.4))[-5:]
    wavname = os.path.join("/home/wwliu/02_wav/", curname + '.wav')
    wav_file = open(wavname, "wb")
    #print("write wav")
    wav_file.write(decode_string)
    wav_file.close()
    #print("trans text")
    #如果需要支持异步多并发操作的话，那么需要在这里加载模型，相当于多起了几个线程一起搞
    text = transcriber.whisper_transcribe(wavname)
    text = hant_2_hans(text)
    e_time = time.time()
    time_info = "{:.2f}".format(e_time - s_time)
    return text, time_info


@app.route('/api/sound/asr', methods=['POST'])
@run_async
async def text_process():
    res_dict = {
        "Status": 200,
        "success": True,
        "result": '',
        "ErrorMessage": "None",
        "InfoMessage": "Received",
        "Debug": {
            "ErrorDetails": "",
            "TimeInfo": {
                "ApiTime": ""
            }
        }
    }
    try:
        data = json.loads(request.data)
    except Exception as e:
        res_dict["success"] = False
        res_dict["ErrorMessage"] = "Params Error"
        res_dict["Debug"]["ErrorDetails"] = str(e) + "\n" + traceback.format_exc()
        return json.dumps(res_dict), {"Content-Type": "application/json;charset=utf-8"}

    try:
        res, time_info = asr_process_api(data)
        # res = '1'
        # time_info = '1'
        res_dict["Debug"]["TimeInfo"]['ApiTime'] = time_info
    except Exception as e:

        res_dict["success"] = False
        res_dict["ErrorMessage"] = "API Error"
        res_dict["Debug"]["ErrorDetails"] = str(e) + "\n" + traceback.format_exc()
        return json.dumps(res_dict), {"Content-Type": "application/json;charset=utf-8"}
    res_dict["result"] = res

    return json.dumps(res_dict), {"Content-Type": "application/json;charset=utf-8"}

